INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (100101, 0, 27, "人助けが大好き！　前向き格闘娘", "東山奈央", 16, 155, "獣人族", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助け、応援", "ヒヨリ", 44, "A", "トゥインクルウィッシュ", 2, 8);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (100201, 0, 5, "戦闘のサポートが得意な、心優しい少女", "種田梨沙", 17, 158, "ヒューマン", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "料理、人間観察", "ユイ", 47, "O", "トゥインクルウィッシュ", 2, 4);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (100301, 0, 12, "クールで何事にも真っ直ぐな剣士", "早見沙織", 18, 163, "魔族", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "読書、乗馬、お茶", "レイ", 46, "B", "トゥインクルウィッシュ", 2, 1);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (100401, 0, 10, "探検好きのイタズラっ子", "諸星すみれ", 9, 128, "ヒューマン", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "いたずら、探検", "ミソギ", 27, "O", "リトルリリカル", 5, 8);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (100501, 0, 25, "ヒーローに憧れる騎士見習いの少女", "下田麻美", 12, 146, "獣人族", "？？？", "ヒーローごっこ", "マツリ", 40, "O", "王宮騎士団（NIGHTMARE）", 8, 11);
