INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (100701, 0, 23, "プリン大好きゴースト娘", "雨宮天", 14, 130, "魔族", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリンを食べること", "ミヤコ", 32, "B", "悪魔偽王国軍（ディアボロス）", 7, 1);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (100801, 0, 10, "ボクは誰よりも美しい", "大空直美", 14, 150, "エルフ", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "鏡で自分を見ること", "ユキ", 40, "AB", "ヴァイスフリューゲル　ランドソル支部", 15, 10);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (100901, 0, 5, "前世を信じる中二病患者、「疾風の冥姫」", "髙野麻美", 17, 159, "魔族", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "小説執筆", "アンナ", 45, "A", "トワイライトキャラバン", 13, 7);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (101001, 0, 22, "マホマホ王国のプリンセス", "内田真礼", 16, 155, "獣人族", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "空想、ぬいぐるみ集め", "マホ", 42, "O", "自警団（カォン）", 10, 9);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (101101, 0, 25, "人懐っこくてマシンガントークな妹系少女", "阿澄佳奈", 15, 156, "ヒューマン", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "お裁縫", "リノ", 44, "A", "ラビリンス", 3, 8);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (101201, 0, 24, "みんなのために超能力を使う眠り姫", "大橋彩香", 17, 156, "エルフ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "妹と遊ぶこと、二度寝、昼寝、早寝", "ハツネ", 46, "A", "フォレスティエ", 6, 12);
