INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (101601, 0, 10, "天真爛漫で人気者のカリスマモデル", "上坂すみれ", 18, 167, "魔族", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "ファッション", "スズナ", 48, "O", "ルーセント学院", 14, 4);
