INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (101801, 0, 14, "多くの男性を魅了する無垢な女教師", "伊藤静", 23, 162, "魔族", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "イオ", 52, "B", "ルーセント学院", 14, 8);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (102001, 0, 3, "お歌もにんじんも、ウサギさんも大好き♪", "日高里菜", 10, 117, "獣人族", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "かわいいもの集め", "ミミ", 21, "O", "リトルリリカル", 5, 4);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (102101, 0, 9, "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", 12, 150, "ヒューマン", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", "クルミ", 40, "B", "サレンディア救護院", 9, 6);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (102201, 0, 22, "人見知りであまのじゃくな女の子", "原紗友里", 13, 150, "魔族", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "ゲーム全般", "ヨリ", 40, "O", "悪魔偽王国軍（ディアボロス）", 7, 11);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (102301, 0, 10, "ぷうきちといつも一緒！", "芹澤優", 14, 148, "ヒューマン", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "屋内でできる遊び", "アヤネ", 38, "B", "サレンディア救護院", 9, 5);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (102501, 0, 12, "お嬢さまのためにがんばるドジっ娘メイド", "悠木碧", 15, 154, "ヒューマン", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "ご奉仕", "スズメ", 43, "O", "サレンディア救護院", 9, 12);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (102601, 0, 1, "遊びと睡眠が何より大事なぐうたら娘", "小岩井ことり", 17, 144, "獣人族", "test", "あんパン", "リン", 42, "B", "牧場（エリザベスパーク）", 11, 1);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (102701, 0, 30, "運命の相手に一途すぎる乙女", "橋本ちなみ", 16, 154, "魔族", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "実験、裁縫、料理", "エリコ", 43, "B", "トワイライトキャラバン", 13, 7);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (102801, 0, 4, "救護院を経営する優しい庶民派お嬢様", "堀江由衣", 17, 156, "エルフ", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "経営、お茶会", "サレン", 43, "A", "サレンディア救護院", 9, 10);
