INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (103001, 0, 31, "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", 16, 163, "ヒューマン", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "忍法開発", "ニノン", 51, "O", "ヴァイスフリューゲル　ランドソル支部", 15, 8);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (103101, 0, 22, "占いが得意な霊能少女", "大坪由佳", 18, 157, "魔族", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占い", "シノブ", 42, "AB", "悪魔偽王国軍（ディアボロス）", 7, 12);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (103201, 0, 12, "一人前の商人を目指すパワフルお嬢様", "松嵜麗", 18, 157, "ヒューマン", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "慈善事業", "アキノ", 45, "AB", "メルクリウス財団", 12, 3);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (103301, 0, 3, "みんなを笑顔にするお笑い牧場主", "新田恵海", 20, 142, "ヒューマン", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "漫才", "マヒル", 35, "B", "牧場（エリザベスパーク）", 11, 3);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (103401, 0, 16, "純情でほっとけない大人の女性", "今井麻美", 22, 164, "エルフ", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "ウインドーショッピング", "ユカリ", 55, "A", "メルクリウス財団", 12, 3);
