INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (103801, 0, 3, "読書が趣味の病弱少女", "小清水亜美", 14, 153, "獣人族", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "読書、お散歩", "シオリ", 40, "A", "牧場（エリザベスパーク）", 11, 11);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (104001, 0, 6, "「友達」に憧れる、エルフの森の女の子", "花澤香菜", 13, 158, "エルフ", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "友達作りのイメトレ", "アオイ", 44, "AB", "フォレスティエ", 6, 6);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (104201, 0, 3, "人々を守るために歌う、唱喚士の少女", "福原綾香", 17, 163, "ヒューマン", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "各種楽器", "チカ", 46, "O", "カルミナ", 4, 6);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (104301, 0, 9, "男勝りで情に厚いワイルド娘", "小松未可子", 17, 168, "獣人族", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "お菓子作り", "マコト", 54, "O", "自警団（カォン）", 10, 8);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (104401, 0, 5, "かつては夜を支配した最強の吸血鬼", "丹下桜", "??", 172, "魔族", "test", "世界征服", "イリヤ", 50, "A", "悪魔偽王国軍（ディアボロス）", 7, 5);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (104501, 0, 19, "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", 18, 157, "ヒューマン", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "小説を読むこと", "クウカ", 49, "AB", "ヴァイスフリューゲル　ランドソル支部", 15, 11);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (104601, 0, 1, "弱きを助け強きをくじく猫娘", "沼倉愛美", 18, 158, "獣人族", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "猫とたわむれること", "タマキ", 48, "AB", "メルクリウス財団", 12, 3);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (104701, 0, 25, "素顔を見せない冷静沈着な女性騎士", "川澄綾子", 25, 171, "ヒューマン", "？？？", "格闘技、湯浴み", "ジュン", 50, "A", "王宮騎士団（NIGHTMARE）", 8, 10);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (104801, 0, 11, "仕事も私事も効率優先な傭兵少女", "田所あずさ", 20, 163, "ヒューマン", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "傭兵などのアルバイト", "ミフユ", 49, "O", "メルクリウス財団", 12, 11);
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (104901, 0, 24, "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", 18, 168, "ヒューマン", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "家事全般", "シズル", 54, "O", "ラビリンス", 3, 10);
