INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (108401, 0, 3, "人々を守るために歌う、唱喚士の少女", "福原綾香", 17, 163, "ヒューマン", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "各種楽器", "チカ（クリスマス）", 46, "O", "カルミナ", 4, 6);
